;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; @@

(defn mapping-mms-access-log [l]
  (let [t (split l #"\s")]
    {
     :ip (get t 0)
     :ts (str-replace #"\[" "" (get t 3))
     :op (str-replace #"\"" "" (get t 5))
     :url(get t 6)
     :http (str (str-replace #"\"" "" (get t 5)) " " (get t 6))
     }
    ))

