(def filter-client-only #(= client-ip (:ip %)))

(defn ops-by-ip [ip d]
  (into {:ip ip} (for [[k v] (group-by :op (filter #(= ip (:ip %)) ad))]
              [k (count v)])))


(table-view (ops-by-ip client-ip ad))
