; client which run this form of ops, for example: POST /ping/v1/95620b7084cf71a6594abf82a5b4cd3d
; can also double check to make sure agent strign is "Go 1.0....", etc

(defn f-mms-agent [e]
  (not-nil? (re-matches #"POST \/ping\/v1\/.*" (:http e))))

(table-view (list (distinct (map #(:ip %) (filter f-mms-agent ad)))))

